description:
The Tamed Teens saga continues: A selection of web auteur Raul Cristian's most potent, erotically misogynistic sequences from the smash www.tamedteens.com. These long-suffering glammed-up European bitches are captured in full-on sexual degradation, with throat-fucking, slapping, name-calling and anal abuse, under the unblinking gaze of Raul's distinctive camerawork. Includes four Raul Cristian trailers.
